import React from 'react';
import classes from './App.module.css';
import p1 from './1.jpg';
import p2 from './2.jpg';
import p3 from './3.jpg';
import p4 from './4.jpg';
import p5 from './5.jpg';

function App() {
  return (
    <div className={classes.container}>
      <div className={classes.header}>
        <h1>Welcome to My Page</h1>
      </div>
      <div className={classes.imageContainer}>
        <img src={p1} alt="Image 1" className={classes.image} />
        <img src={p2} alt="Image 2" className={classes.image} />
        <img src={p3} alt="Image 3" className={classes.image} />
        <img src={p4} alt="Image 4" className={classes.image} />
        <img src={p5} alt="Image 5" className={classes.image} />
      </div>
    </div>
  );
}

export default App;
